package src;

public class Task2 {
	
	public static void main(String[] args) {
		String input[] = new String[5];
		input[0] = "";
		input[1] = "";
		input[2] = "";
		input[3] = "";
		input[4] = "";
		
		int position = 5;
		for (String moveset : input) {
			for (char move : moveset.toCharArray()) {
				position = getPosition(position, move);
			}
			System.out.println(position);
		}
	}

	private static int getPosition(int position, char move) {
		switch (position) {
			case 1:
				switch (move) {
				    case 'U': return position;
	                case 'L': return position;
					case 'R': return 2;
					case 'D': return 4;			 		
				};
			case 2:
				switch (move) {
					case 'U': return position;
					case 'L': return 1;				
					case 'R': return 2;
					case 'D': return 5; 
				};
			case 3:
				switch (move) {
					case 'U': return position;
					case 'L': return 2;
					case 'R': return position;
					case 'D': return 6;
				};
			case 4:
				switch (move) {
				case 'U': return 1;
				case 'L': return position;
				case 'R': return 5;
				case 'D': return 7;
			};
			case 5:
				switch (move) {
					case 'U': return 2;
					case 'L': return 4;
					case 'R': return 6;
					case 'D': return 8;
				};
			case 6:
				switch (move) {
				case 'U': return 3;
				case 'L': return 5;
				case 'R': return position;
				case 'D': return 9;
			};
			case 7:
				switch (move) {
				case 'U': return 4;
				case 'L': return position;
				case 'R': return 8;
				case 'D': return position;
			};
			case 8:
				switch (move) {
				case 'U': return 5;
				case 'L': return 7;
				case 'R': return 9;
				case 'D': return position;
			};
			case 9:
				switch (move) {
				case 'U': return 6;
				case 'L': return 8;
				case 'R': return position;
				case 'D': return position;
			};
		};
		return position;
	}

}
